import React from 'react';
// import './homelogo.css';

const defaultProfPic= require('./logo.png');

const HomeLogo = ({profpic}) =>
    <div id="whole">
        <div id="homeimage"><img src={profpic} /></div>
    </div>;

ResultImage.defaultProps = {
    profpic:defaultProfPic,
}

export default HomeLogo;
